import { GetSenlogByList } from '@/api/platformcoupon';
import { Citylist } from '@/api/city';
import waves from '@/directive/waves';
import { GetDataByShopAll } from "@/api/shop";
export default {
  directives: {
    waves: waves
  },
  data: function data() {
    return {
      shop: [],
      pickerOptions: {
        shortcuts: [{
          text: '最近一周',
          onClick: function onClick(picker) {
            var end = new Date();
            var start = new Date();
            start.setTime(start.getTime() - 3600 * 1000 * 24 * 7);
            picker.$emit('pick', [start, end]);
          }
        }, {
          text: '最近一个月',
          onClick: function onClick(picker) {
            var end = new Date();
            var start = new Date();
            start.setTime(start.getTime() - 3600 * 1000 * 24 * 30);
            picker.$emit('pick', [start, end]);
          }
        }, {
          text: '最近三个月',
          onClick: function onClick(picker) {
            var end = new Date();
            var start = new Date();
            start.setTime(start.getTime() - 3600 * 1000 * 24 * 90);
            picker.$emit('pick', [start, end]);
          }
        }]
      },
      listQuery: {
        page: 1,
        limit: 10,
        status: undefined,
        title: '',
        sstatus: 'all',
        nickname: '',
        contact: '',
        cityCode: ''
      },
      statusOp: [{
        label: '成功',
        value: 1
      }, {
        label: '失败',
        value: 2
      }],
      sumprice: 0,
      list: null,
      total: 1,
      checked: true,
      listLoading: true,
      cityoptions: [] // 地址

    };
  },
  created: function created() {
    var _this = this;

    GetDataByShopAll().then(function (res) {
      _this.shop = res.data;
    });
    this.fetchList();
  },
  methods: {
    fetchList: function fetchList() {
      var _this2 = this;

      this.listLoading = true;
      GetSenlogByList(this.listQuery).then(function (response) {
        _this2.list = response.data.data;
        _this2.total = response.data.total;
        _this2.sumprice = response.data.sumprice;
        _this2.listLoading = false;
      });
    },
    handleFilter: function handleFilter() {
      this.listQuery.page = 1;
      this.fetchList();
    },
    handleSizeChange: function handleSizeChange(val) {
      this.listQuery.limit = val;
      this.fetchList();
    },
    handleCurrentChange: function handleCurrentChange(val) {
      this.listQuery.page = val;
      this.fetchList();
    }
  }
};
